import React  from "react";

function Table_column_child(props){
    console.log("Table_column_child");
    let style_p = {display:"none"};
    let style_p2 = {display:"none"};
    let style_p3 = {display:"none"};
    let style_p4 = {display:"none"};
    let style_s = {display:"none"};
    let style_s2 = {display:"none"};
    let style_s3 = {display:"none"};
    let style_s4 = {display:"none"};

    if(props.num===props.boy_p.bo1){
        style_p = {display:"block"};
    }else if(props.num === props.boy_p.boy2){
        style_p2 = {display:"block"};
    }else if(props.num === props.boy_p.boy3){
        style_p3 = {display:"block"};
    }else if(props.num === props.boy_p.boy4){
        style_p4 = {display:"block"};
    }


    return(
        <div className={`${props.table_column_children} d-flex justify-content-center align-items-center  border-dark text-center`}>
            <div style={{position:"absolute"}}> {props.num} </div>
            <div className={`rounded-circle border Boy`} style={style_p}></div>
            <div className={`rounded-circle border Boy`} style={style_p2}></div>
            <div className={`rounded-circle border Boy`} style={style_p3}></div>
            <div className={`rounded-circle border Boy`} style={style_p4}></div>
            <div className={`rounded-circle border Boy`} style={style_s}></div>
            <div className={`rounded-circle border Boy`} style={style_s2}></div>
            <div className={`rounded-circle border Boy`} style={style_s3}></div>
            <div className={`rounded-circle border Boy`} style={style_s2}></div>
            <div className={`rounded-circle border Boy`} style={style_s2}></div>
        </div>
    )
}

export default Table_column_child;
